import "../Style/header.css"
import myImage from '../Images/LilSkull_white.png';

function Header() {
    return (
function Header() {
    return (
        <nav className="navbar navbar-expand-lg navbar-dark">
            <a className="navbar-brand" href="#homeLink"><img src={myImage} width={30} height={30} className="d-inline-block align-top" alt="LittleSkullIcon" /><span className="name">DAVID ROBERTSON</span><span className="portfolio"> PORTFOLIO</span></a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon" />
            </button>
            <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                <ul className="navbar-nav ms-auto">
                    <NavLink className="nav-link" to="/" end>ABOUT</NavLink>
                    <NavLink className="nav-link" to="/Projects" end>PROJECTS</NavLink>
                    <NavLink className="nav-link" to="/Contact" end>CONTACT</NavLink>
                </ul>
            </div>
        </nav>
    );
}
    );
}

export default Header;
